     &    Sub2705(HelAll(Gen(1)),Gen6,Neu(3),Sfe6,Sfe7)

        Sub2707(HelAll(Gen(1)),Gen6,Neu(3),Sfe6,Sfe7) = 
     &   (2*CB2*Sub2703(HelAll(Gen(1)),Gen6,Neu(3),Sfe6,Sfe7) - 
     &      S2B*Sub2706(HelAll(Gen(1)),Gen6,Neu(3),Sfe6,Sfe7))/
     &    (CB2*S2B)

        ENDLOOP(Gen6)
